(14, 'logos', '[{\"image_name\":\"1820874138_brand-1.png\",\"image\":\"1820874138_brand-1.png\"},{\"image_name\":null,\"image\":\"1848025974_brand-2.png\"},{\"image_name\":null,\"image\":\"646101571_brand-3.png\"},{\"image_name\":null,\"image\":\"1523437226_brand-4.png\"},{\"image_name\":null,\"image\":\"1959841223_brand-5.png\"},{\"image_name\":null,\"image\":\"1182488469_brand-6.png\"}]', 'contact', '2022-08-26 22:13:24', '2022-08-26 22:13:58'),
(15, 'page_content', '\"<p>Privacy<\\/p>\"', 'contact', '2022-08-29 21:18:59', '2022-08-29 21:18:59'),
(16, 'page_content', '\"<div><h3><font face=\\\"Arial\\\"><span style=\\\"font-family: \\\" akkurat=\\\"\\\" cointreau\\\";\\\"=\\\"\\\">Privacy Policy<\\/span><\\/font><\\/h3><font face=\\\"Arial\\\"><span style=\\\"font-family: \\\" akkurat=\\\"\\\" cointreau\\\";\\\"=\\\"\\\">An Intellectual Property clause will inform users that the contents, logo and other visual media you created is your property and is protected by copyright laws.<\\/span><\\/font><\\/div><div><font face=\\\"Arial\\\"><span style=\\\"font-family: \\\" akkurat=\\\"\\\" cointreau\\\";\\\"=\\\"\\\">A Termination clause will inform users that any accounts on your website and mobile app, or users\' access to your website and app, can be terminated in case of abuses or at your sole discretion.<\\/span><\\/font><\\/div><div><font face=\\\"Arial\\\"><span style=\\\"font-family: \\\" akkurat=\\\"\\\" cointreau\\\";\\\"=\\\"\\\">A Governing Law clause will inform users which laws govern the agreement. These laws should come from the country in which your company is headquartered or the country from which you operate your website and mobile app.<\\/span><\\/font><\\/div><div><font face=\\\"Arial\\\"><span style=\\\"font-family: \\\" akkurat=\\\"\\\" cointreau\\\";\\\"=\\\"\\\">A Links to Other Websites clause will inform users that you are not responsible for any third party websites that you link to. This kind of clause will generally inform users that they are responsible for reading and agreeing (or disagreeing) with the Terms and Conditions or Privacy Policies of these third parties.<\\/span><\\/font><\\/div><div><font face=\\\"Arial\\\"><span style=\\\"font-family: \\\" akkurat=\\\"\\\" cointreau\\\";\\\"=\\\"\\\">If your website or mobile app allows users to create content and make that content public to other users, a Content clause will inform users that they own the rights to the content they have created. This clause usually mentions that users must give you (the website or mobile app developer\\/owner) a license so that you can share this content on your website\\/mobile app and to make it available to other users.<\\/span><\\/font><\\/div><div><font face=\\\"Arial\\\"><br><\\/font><\\/div><div><font face=\\\"Arial\\\">Because the content created by users is public to other users, a DMCA notice clause (or Copyright Infringement ) section is helpful to inform users and copyright authors that, if any content is found to be a copyright infringement, you will respond to any DMCA takedown notices received and you will take down the content.&nbsp;<\\/font><\\/div>\"', 'privacy-policy', '2022-08-29 21:52:18', '2022-09-22 23:32:00'),
(17, 'page_content', '\"<h3>Terms and conditions<\\/h3><p><br>An Intellectual Property clause will inform users that the contents, logo and other visual media you created is your property and is protected by copyright laws.<\\/p><p>A Termination clause will inform users that any accounts on your website and mobile app, or users\' access to your website and app, can be terminated in case of abuses or at your sole discretion.<\\/p><p>A Governing Law clause will inform users which laws govern the agreement. These laws should come from the country in which your company is headquartered or the country from which you operate your website and mobile app.<\\/p><p>A Links to Other Websites clause will inform users that you are not responsible for any third party websites that you link to. This kind of clause will generally inform users that they are responsible for reading and agreeing (or disagreeing) with the Terms and Conditions or Privacy Policies of these third parties.<\\/p><p>If your website or mobile app allows users to create content and make that content public to other users, a Content clause will inform users that they own the rights to the content they have created. This clause usually mentions that users must give you (the website or mobile app developer\\/owner) a license so that you can share this content on your website\\/mobile app and to make it available to other users.<\\/p><p><br><\\/p><p>Because the content created by users is public to other users, a DMCA notice clause (or Copyright Infringement ) section is helpful to inform users and copyright authors that, if any content is found to be a copyright infringement, you will respond to any DMCA takedown notices received and you will take down the content.<\\/p>\"', 'terms-and-conditions', '2022-08-29 21:57:04', '2022-08-29 23:47:45');
