INSERT INTO `items` (`id`, `name`, `slug`, `bar_id`, `drink_id`, `description`, `media`, `media_type`, `price`, `status`, `created_at`, `updated_at`) VALUES
(37, 'Test Item', 'test-item-1', 33, 0, '<p>Test Item Description</p>', NULL, 'image', '{\"quantity\":[\"Bottle\"],\"price\":[\"100\"]}', 1, '2022-02-14 21:59:07', '2022-02-14 21:59:07'),
(42, 'Cosmopolitan', 'cosmopolitan', 19, 39, 'The rise of Cosmopolitan marked the return of premium and fresh ingredients to the cocktail glass. This pink blushed beauty is one of the most revered modern Cointreau classic.', '[\"1262482512Medium-Cointreau-Photo-cocktail-cosmopolitan.jpg\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"90\"]}', 1, '2022-02-23 15:37:17', '2022-03-11 02:07:48'),
(43, 'Kamikaze', 'kamikaze', 19, 39, '<p>kamikaze<br></p>', '[\"619731828C0209-kamikaze.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"95\"]}', 1, '2022-02-23 15:40:53', '2022-03-11 02:07:03'),
(44, 'Mai Tai', 'mai-tai', 19, 39, '<p><div class=\"tab__content js-tab-content js-visible\" data-key=\"ingredients\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; display: block; animation: 0s ease 0s 1 normal none running none; color: rgb(0, 0, 0); font-family: Akkurat, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"app-cocktail-info__details\" style=\"box-sizing: inherit; margin: 3rem 0px 0px; padding: 0px; align-items: flex-start; width: 1070px; display: flex; gap: 100px;\"><div class=\"app-cocktail-info__details__image\" itemprop=\"image\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; position: relative; display: block; width: 485px; flex-basis: 50%;\"></div></div></div></p><div class=\"app-cocktail-info__intro text-left wax-wysiwyg-content\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-align: left; -webkit-font-smoothing: antialiased; color: rgb(9, 45, 77); font-family: Akkurat, sans-serif; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"box-sizing: inherit; margin: 0px; padding: 0px; font-size: inherit; line-height: 1.2; text-rendering: optimizelegibility;\">Created in 1944 by Victor Jules Bergeron known as Trader Vic. It takes its name from the Tahitian words \"mai tai-roa a\" which means \"out of this world the best!\"</p></div>', '[\"181111087C0239-mai-tai.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"50\"]}', 1, '2022-02-23 15:43:35', '2022-03-11 02:09:07'),
(45, 'Mimosa', 'mimosa', 19, 39, '<p>The Mimosa was created at the Ritz Hotel in Paris. Add a splash of Cointreau to your Mimosa and you have a delightful eye opener that will brighten up anyones morning.<br></p>', '[\"1149057064C0248-mimosa.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"100\"]}', 1, '2022-02-23 15:45:43', '2022-03-01 23:33:52'),
(46, 'Sidecar', 'sidecar', 19, 39, '<p>The first iconic Cointreau cocktail. The Sidecar traces its heritage back in 1922 in London. A perfect balance between Cointreau, Cognac, and lemon, the Sidecar is a classic that has endured generation after generation. The final touch of a sugared rim provides a perfect balance of sweet and sour.</p><p><br></p>', '[\"1145891256C0290-sidecar.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"100\"]}', 1, '2022-02-23 15:49:09', '2022-03-11 02:19:28'),
(47, 'Singapore sling', 'singapore-sling', 19, 39, '<p>This is the recipe served today at the Raffles Hotel in Singapore. It is said to have been invented by Ngiam Tong Boon, in the 1910\'s.<br></p>', '[\"1182701903C0294-singapore-sling.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"70\"]}', 1, '2022-02-23 15:52:30', '2022-03-11 02:25:20'),
(48, 'Margarita', 'margarita', 19, 39, '<p><font color=\"#092d4d\" face=\"Akkurat, sans-serif\"><span style=\"font-size: 16px;\">The Margarita was originally created when Dallas socialite Margarita Sames mixed her two favorite spirits, Cointreau and tequila, together with lime juice while on vacation in Acapulco back in 1948. This original Margarita recipe has stood the test of over 70 years time.</span></font><br></p>', '[\"187256818original-magarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"80\"]}', 1, '2022-02-23 15:54:08', '2022-03-11 02:28:07'),
(49, 'White Lady', 'white-lady', 19, 39, '<p>The White Lady, mixed by the actress Lilian Harvey, won a cocktail competition in Berlin in April 1930. It was then published in the Savoy Cocktail Book the same year, being attributed to Harry Craddock, author and head bartender at the Savoy Hotel in London.</p>', '[\"1995509846C0337-white-lady.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"88\"]}', 1, '2022-02-23 16:00:36', '2022-03-11 02:32:03'),
(50, 'Berry Fizz', 'berry-fizz', 19, 40, '<p>Look to the bramble bush at the turn of the season for a more fruity Rickey. The muddled berries create a colorful and fruitier Cointreau Rickey variation.<br></p>', '[\"967730456C0082-cointreau-berry-fizz.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"60\"]}', 1, '2022-02-23 16:03:57', '2022-03-11 19:01:27'),
(51, 'Cucumber Mint Fizz', 'cucumber-mint-fizz', 19, 40, '<p>The cooling taste of cucumber pops with the addition of fresh mint, making this Rickey a perfect refresher.<br></p>', '[\"2034529988C0092-cointreau-cucumber-mint-fizz.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"50\"]}', 1, '2022-02-23 16:06:03', '2022-03-11 19:02:28'),
(52, 'Grapefruit Fizz', 'grapefruit-fizz', 19, 40, '<p><font color=\"#092d4d\" face=\"Akkurat, sans-serif\"><span style=\"font-size: 16px;\">Refreshingly tart grapefruit juice is ready to quinch your thirst when married with the bright orange notes of Cointreau. A delicate balance of bitter and sweet, the Cointreau Grapefruit Rickey is a perfect Summer sipper.</span></font><br></p>', '[\"933229980C0102-cointreau-grapefruit-fizz.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"50\"]}', 1, '2022-02-23 16:08:19', '2022-03-11 19:09:59'),
(53, 'Strawberry Basil Fizz', 'strawberry-basil-fizz', 19, 40, '<p>The distinct aromatics of fresh basil greet your palate with the promise of warmer weather. Paired with ripe strawberries, Cointreau, and lime, this Rickey tastes as beautiful as it looks.<br></p>', '[\"23010903C0110-cointreau-strawberry-basil-fizz.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"99\"]}', 1, '2022-02-23 16:10:14', '2022-03-11 19:11:12'),
(54, 'Cointreau Holiday Jam', 'cointreau-holiday-jam', 19, 40, '<p>A blackberry jam variation of the classic cosmopolitan cocktail!<br></p>', '[\"1545665886C0188-holiday-jam.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"67\"]}', 1, '2022-02-23 16:11:58', '2022-03-11 19:13:50'),
(55, 'Honey, I\'m home', 'honey-i-m-home', 19, 40, '<div class=\"app-cocktail-info__intro text-left wax-wysiwyg-content\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; -webkit-font-smoothing: antialiased;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 1.2; text-rendering: optimizelegibility;\"><font color=\"#092d4d\">This Bourbon Milk Punch is fit for a crowd!</font></p></div>', '[\"1517307404C0188-holiday-jam.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"67\"]}', 1, '2022-02-23 16:16:54', '2022-03-11 19:16:07'),
(56, 'Mulled Cider', 'mulled-cider', 19, 40, '<p>A warm and spiced Cointreau cider, perfect for the colder days shared with family and friends during the holidays.<br></p>', '[\"1689127470C0195-hot-cointreau-mulled-cider.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"79\"]}', 1, '2022-02-23 16:21:09', '2022-03-11 19:19:17'),
(57, 'Shake your pom pomegranate', 'shake-your-pom-pomegranate', 19, 40, '<p>Like a classic cosmopolitan but with pomegranate juice!<br></p>', '[\"28940837C0288-shake-your-pom-pomegranate.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"60\"]}', 1, '2022-02-23 16:23:15', '2022-03-11 19:21:06'),
(58, 'Some like it hot', 'some-like-it-hot', 19, 40, '<p>A spicy tequila twist on the classic cosmopolitan!<br></p>', '[\"1655920810C0299-some-it-hot.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"77\"]}', 1, '2022-02-23 16:26:26', '2022-03-11 19:22:33'),
(59, 'The In-cider', 'the-in-cider', 19, 40, '<p><font face=\"Akkurat, sans-serif\"><span style=\"font-size: 16px;\">An Apple Cider Rum Punch fit for a crowd!</span></font><br></p>', '[\"951561923C0325-cider.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"30\"]}', 1, '2022-02-23 16:30:33', '2022-03-11 19:25:32'),
(60, 'Whisket, Spice + Everything NIce', 'whisket-spice-everything-nice', 19, 40, '<p>A whiskey-based cosmopolitan with a gingery kick!<br></p>', '[\"1839286384C0336-whiskey-spice-everything-nice.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"120\"]}', 1, '2022-02-23 16:33:51', '2022-03-01 23:33:54'),
(61, 'Winter white cosmopolitan', 'winter-white-cosmopolitan', 19, 40, '<p><font face=\"Akkurat, sans-serif\"><span style=\"font-size: 16px;\">Use white cranberry juice instead of the classic to make this winter-perfect cocktail!</span></font><br></p>', '[\"1094440659C0342-winter-white-cosmopolitan.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"130\"]}', 1, '2022-02-23 16:39:54', '2022-03-11 19:29:23'),
(62, 'CNY Margarita', 'cny-margarita', 19, 41, '<p>Yuzu, jasmin, and baiju lend a fresh Chinese flavor profile for this Chinese New Year inspired Margarita.<br></p>', '[\"849300668C0073-chinese-ny-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"100\"]}', 1, '2022-02-23 16:42:15', '2022-03-11 19:32:25'),
(63, 'FAll Margarita', 'fall-margarita', 19, 41, '<p>After the thrills of summer comes the chill of autumn, and there is a Margarita for it. This recipe features smoked black salt and elderflower cordial. Historically, elderflower was treasured for its phytotherapeutic virtues. In the early days of fall, consuming elderflower infusions is believed to protect against those pesky seasonal flus and colds. The black salt, which comes from the natural combination of sea salt and volcanic rock, delivers a deep, lightly smoked salt, naturally rich in purifying activated charcoal.<br></p>', '[\"1141425932C0142-fall-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"90\"]}', 1, '2022-02-23 16:45:44', '2022-03-11 19:41:12'),
(64, 'Frozen Mango Margarita', 'frozen-mango-margarita', 19, 41, '<p>Try the frozen version of one of our most loved Margaritas, The Frozen Mango Margarita.<br></p>', '[\"670057189C0160-frozen-mango-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"70\"]}', 1, '2022-02-23 16:48:16', '2022-03-11 19:45:03'),
(65, 'Frozen Margarita', 'frozen-margarita', 19, 41, '<p><font face=\"Akkurat, sans-serif\"><span style=\"font-size: 16px;\">The Original Margarita was created back in 1948 when Dallas socialite Margarita Sames mixed her two favorite spirits, Cointreau, tequila, together with lime juice. Try the frozen version of this recipe that has stood the test of 70 years\' time.</span></font><br></p>', '[\"258172948Webp.net-resizeimage (3).gif\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"30\"]}', 1, '2022-02-23 16:50:18', '2022-04-22 16:54:00'),
(66, 'Frozen Watermelon margarita', 'frozen-watermelon-margarita', 19, 41, '<p>Try the frozen version of one of our most loved Margaritas, The Frozen Watermelon Margarita.<br></p>', '[\"75533101C0162-frozen-watermelon-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"80\"]}', 1, '2022-02-23 16:53:35', '2022-03-11 19:47:28'),
(67, 'Luxe margarita', 'luxe-margarita', 19, 41, 'This margarita is for celebrating the unconventional. Those who want to try a different spin on the original margarita should try this. It is sure to surprise and impress your friends.', '[\"81226857C0238-luxe-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"50\"]}', 1, '2022-02-23 16:56:13', '2022-03-11 19:50:16'),
(68, 'Pumpkin Spice Margarita', 'pumpkin-spice-margarita', 19, 41, '<p>Calling all pumpkin spiced latte lovers! The Pumpkin Spiced Margarita is going to be your next fall-favorite cocktail<br></p>', '[\"956639376C0273-psm-pumpkin-spice-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"60\"]}', 1, '2022-02-23 16:59:03', '2022-03-11 19:53:11'),
(69, 'Spicy Margarita', 'spicy-margarita', 19, 41, '<div class=\"app-cocktail-info__intro text-left wax-wysiwyg-content\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; -webkit-font-smoothing: antialiased;\"><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 1.2; text-rendering: optimizelegibility;\">Bring a little heat to an iconic classic by adding jalapeno and cilantro to your Margarita. Your tastebuds may walk on fire, until the subtle sweetness of Cointreau washes over the flame.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; line-height: 1.2; text-rendering: optimizelegibility;\"><br></p></div>', '[\"748543377C0305-spicy-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"70\"]}', 1, '2022-02-23 17:01:13', '2022-03-11 19:54:27'),
(70, 'The Original Margarita', 'the-original-margarita', 19, 41, '<p>The Margarita was originally created when Dallas socialite Margarita Sames mixed her two favorite spirits, Cointreau and tequila, together with lime juice while on vacation in Acapulco back in 1948. This original Margarita recipe has stood the test of over 70 years time.</p>', '[\"165029773Original_Margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"40\"]}', 1, '2022-02-23 17:02:41', '2022-03-11 19:55:57'),
(71, 'Winter Margarita', 'winter-margarita', 19, 41, '<p>Born in 2015 at the elegant Victoria 1836 in Paris, a gastronomic institution tucked away behind the Arc de Triomphe, this Margarita twist was originally created for a high-profile guest with a particular affinity for cinnamon. Fresh passion fruit brings a hint of acidity that balances the aromatic force of the cinnamon. And the delicacy of Gurande salt proves the ideal way to top off this heartwarming cocktail.<br></p>', '[\"1970626095C0340-winter-margarita.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"89\"]}', 1, '2022-02-23 17:04:40', '2022-03-11 19:56:48'),
(72, 'LOUIX XIII', 'louix-xiii', 19, 42, '<p>First created in 1874, LOUIS XIII Cognac is an exquisite blend of up to 1,200 grapes eaux-de-vie sourced 100% from Grande Champagne, the first cru of the Cognac region. Each eau-de-vie is matured slowly inside oak cask. The embodiment of an ancestral savoir-faire, LOUIS XIII Cognac has been watched over by generations of Cellar Masters since its origins. Each Cellar Master selects and sets aside for his successors the oldest and greatest eaux-de-vie from LOUIS XIII cellars, which makes LOUIS XIII the ultimate expression of the mastery of Time. Today, Cellar Master Baptiste Loiseau is setting aside our finest eaux-de-vie, as a legacy to his successors for the coming century.<br></p>', '[\"509244208C0340-winter-margarita.webp\"]', 'image', '{\"quantity\":[\"0.5 OZ\",\"1 OZ\",\"BOTTLE\"],\"price\":[\"5\",\"20\",\"100\"]}', 1, '2022-02-23 17:15:39', '2022-03-11 21:21:13'),
(73, 'REMY MARTIN XO', 'remy-martin-xo', 19, 42, '<p>Rmy Martin XO is composed of eaux-de-vie coming exclusively from the most sought-after vineyards of Cognac: Grande Champagne and Petite Champagne. This beautiful Cognac is the signature of our Cellar Master who, with his expertise, managed to blend up to 400 different eaux-de-vie. This art of blending allows him to perfectly express the full aromatic complexity of this XO Fine Champagne cognac<br></p>', '[\"11220211453. Medium-Remy Martin-Photo-RM_XO_OPULENCE_CGJ_210303_02_120_HORIZONTAL (1).jpg\"]', 'image', '{\"quantity\":[\"0.5 OZ\",\"1 OZ\",\"Bottle\"],\"price\":[\"6\",\"60\",\"90\"]}', 1, '2022-02-23 17:20:55', '2022-03-11 21:19:06'),
(74, 'REMY MARTIN VSOP', 'remy-martin-vsop', 19, 42, '<p>Rmy Martin VSOP embodies the perfect harmony of powerful and elegant aromas. It is the symbol of the Cellar Masters art of blending since the first craft in 1927, when Andr Renaud created the first ever VSOP Fine Champagne Cognac.<br></p>', '[\"16219574862. Medium-Remy Martin-Photo-VSOP_Neat_Bottle_lowres.jpg\"]', 'image', '{\"quantity\":[\"0.5 OZ\",\"1 OZ\",\"Bottle\"],\"price\":[\"7\",\"70\",\"170\"]}', 1, '2022-02-23 17:22:27', '2022-03-11 21:20:00'),
(75, 'The Botanist', 'the-botanist', 19, 42, '<p>The Botanist islay dry gin is a spirit of layered complexity. 22 hand-foraged local island botanicals delicately augment nine berries, barks, seeds & peels.<br></p>', '[\"17645393351. Remy_G&T_Digital-Recipe-Card_202011302 (1).jpg\"]', 'image', '{\"quantity\":[\"0.5 OZ\",\"1 OZ\",\"Bottle\"],\"price\":[\"5\",\"50\",\"500\"]}', 1, '2022-02-23 17:24:29', '2022-03-11 21:21:55'),
(76, 'Cointreau', 'cointreau', 19, 42, '<p>Cointreau: a masterpiece crafted through the unique distillation of all-natural sweet and bitter orange peels, resulting in a crystal clear liqueur that strikes the perfect balance between sweetness and freshness. For more than 30 years, the finest orange peels are carefully selected by our Master Distiller, Carole Quinton, to create the definitive orange liqueur.<br></p>', '[\"12528684481. Web-Cointreau-Photo-Bottle_ 09.jpg\"]', 'image', '{\"quantity\":[\"0.5 OZ\",\"1 OZ\",\"Bottle\"],\"price\":[\"10\",\"60\",\"110\"]}', 1, '2022-02-23 17:26:12', '2022-03-11 20:09:44'),
(77, 'Mount gay eclipse', 'mount-gay-eclipse', 19, 42, '<p>Mount Gay Eclipse is named after the 1910 total solar eclipse that was visible from Barbados. It is a blend of rums distilled in traditional copper pot and column stills, then matured for 2 years solely in American whiskey casks.</p><p><br></p><p>Eclipse is the embodiment of the Mount Gay style with notes of fresh vanilla, almond, ripe banana and dark</p><p>chocolate.</p>', '[\"268842382Medium-Mount Gay-Photo-Mount Gay Eclipse - Bottle & Beach 2 - LR.jpg\"]', 'image', '{\"quantity\":[\"0.5 OZ\",\"1 OZ\",\"Bottle\"],\"price\":[\"7\",\"57\",\"200\"]}', 1, '2022-02-23 17:28:18', '2022-03-11 21:29:41'),
(78, 'Mount gay xo', 'mount-gay-xo', 19, 42, '<p>Mount Gay XO is a small-batch blend of carefully selected mature rums. A round and complex rum, XO delivers flavours of salted caramel, baked fig, clove and dark chocolate. It is distilled in traditional copper pot and column stills and matured between 5 to 17 years in American whiskey, bourbon and cognac casks.<br></p>', '[\"1653381291. Medium-Mount Gay-Photo-Mount Gay XO - Bottle& Box & Pot Still - HR.jpg\"]', 'image', '{\"quantity\":[\"0.5 OZ\",\"1 OZ\",\"Bottle\"],\"price\":[\"5\",\"100\",\"500\"]}', 1, '2022-02-23 17:29:42', '2022-03-11 21:31:32'),
(93, 'Beachcomber', 'beachcomber', 19, 39, '<p><span style=\"color: rgb(9, 45, 77); font-family: Akkurat, sans-serif; font-size: 16px;\">This Tiki classic can be found on the pages of Trader Vic 1947 Bartenders Guide, refreshing and bright, this cocktail puts a tasty twist on the classic Daiquiri.</span><br></p>', '[\"1247124152C0033-beachcomber.webp\"]', 'image', '{\"quantity\":[\"Full\"],\"price\":[\"100\"]}', 1, '2022-03-11 00:41:29', '2022-03-11 00:41:29'),
